<!DOCTYPE html>
<html><head>
        <title>Mis Redes sociales :)</title>
        <meta charset="UTF-8">
        <script src="https://use.fontawesome.com/releases/v5.0.13/js/all.js"></script>
        <style>
            /**/
            body{
                background-color:gray;
                max-width:100%;height:auto;
                padding-left:auto;padding-right:auto;
            }
            .all{
                max-width:100%;margin:36px;padding:auto;
            }
            .case{
                max-width:270px;height:506px;
                display:block;margin-left:auto;margin-top:auto;margin-bottom:auto;
                margin-right:auto;
                background-color:#be03fc;
                border:10px solid #be03fc;
                border-radius:30px;
            }
            .second{
                max-width:100%;height:486px;
                display:block;margin-left:auto;margin-right:auto;
                background-color:#292f30;
                border:10px solid #292f30;border-radius:30px;
            }
            .silver{
                max-width:10px;height:0.1em;background-color:#292a30;
                border-radius:100%;padding:10px;margin-top:-10px;
                display:block;margin-left:auto;margin-right:auto;
            }
            .camera{
                background-color:#0d161a;border-radius:100px;
                display:block;width:15px;height:15px;margin-bottom:20px;
                margin-left:auto;margin-right:auto;margin-top:-18px;
            }
            .screen{
                background-color:#ffffff;
                max-width:100%;height:420px;border-radius:10px;
                padding:2px;margin:5px;
                display:block;margin-left:auto;margin-right:auto;
                margin-top:10px;margin-bottom:16px;overflow-y:auto;overflow-x:none;
            }
            .heading{
                max-width:100%;font-size:20px;
                height:auto;display:block;min-width:100%;}
            .user{
                box-shadow:2px 3px 4px gray;display:inline-block;
                width:10%;color:white;height:20px;text-align:center;
                background-color:#dd00de;margin:16px 2px 16px 20px;
                padding:10px;border-radius:50px;
            }
            .me{
                color:white;font-weight:900;text-align:center;
                box-shadow:2px 3px 4px gray;background-color:#dd00de;
                font-weight:400;padding:10px;border-radius:50px;
                display:inline-block;margin:16px 8px;
                width:50%;height:20px;
            }
            .insta{
                display:block;margin-left:auto;margin-right:auto;
                color:#00eedd;background-color:rgba(50,10,70,0.5);
                max-width:100%;height:auto;box-shadow:2px 3px 4px gray;
                text-align:center;padding:10px;
                border-radius:10px;margin:20px;
            }
            .fb{
                display:block;margin-left:auto;margin-right:auto;
                color:#00eedd;background-color:rgba(50,10,70,0.5);
                max-width:100%;height:auto;box-shadow:2px 3px 4px gray;
                text-align:center;padding:10px;
                border-radius:10px;margin:20px;
            }
            .twitter{
                display:block;margin-left:auto;margin-right:auto;
                color:#00eedd;background-color:rgba(50,10,70,0.5);
                max-width:100%;height:auto;box-shadow:2px 3px 4px gray;
                text-align:center;padding:10px;
                border-radius:10px;margin:20px;
            }
            .tiktok{
                display:block;margin-left:auto;margin-right:auto;
                color:#00eedd;background-color:rgba(50,10,70,0.5);
                max-width:80%;height:auto;box-shadow:2px 3px 4px gray;
                text-align:center;padding:10px;
                border-radius:10px;margin:20px;
            }
            .botton{
                border:1px solid #0d161a;border-radius:4px;
                background-color:rgba(50,50,50,0.6);padding:2px;
                max-width:100%;height:20px;margin-top:-10px;
                padding-left:66px;padding-right:66px;position:absolute;
                display:block;margin-left:auto;margin-right:auto;
            }
            .triangle{
                display:inline-block;margin:0 10px;
                max-width:30%;height:20px;
                font-size:23px;font-weight:400;
                color:#0d161a;vertical-align:3px;
            }
            .middle{
                display:inline-block;margin:0 10px;
                max-width:30%;height:20px;
                color:#0d161a;vertical-align:7px;
            }
            .square{
                display:inline-block;margin:0 10px;
                max-width:30%;height:20px;
                color:#0d161a;vertical-align:7px;
            }
            footer{
                text-align:right;
            }
    /*adding responsive design to the site*/
            @media screen (max-width:1366px;){
             .case{
                max-width:670px;height:806px;
            }

                max-width:100%;height:786px;

            }
            .botton{
                padding:2px;max-width:100%;height:20px;margin-top:-10px;
                padding-left:76px;padding-right:76px;
            }
}
